  false,\n\t\"url\": null,\n\t\"notes\": \"Oceanographic data from CTD casts from
  from 01 May 1992 to 08 May 1992. Data were collected by Texas A&M Universtiy (TAMU)
  as part of the Texas-Louisiana Shelf Circulation and Transport Processes Study (LATEX
